import React from "react";

function Main() {
  return (
    <div className="main-div">
      <section className="section-main">
        <h1 class="btnOff">WEB, MOBILE, DESIGN & Neural Networks</h1>
        <div className="innerSectionDiv" aria-hidden="true">
          <span className="typeOfPoss sizeOfPoss animOfPoss">
            web, mobile, design
          </span>
          <span className="typeOfPoss sizeOfPoss animOfPoss positionOfPoss">
            neural networks
          </span>
          <span class="typeOfPro sizeOfPro animOfPro">
            СОЗДАНИЕ ЦИФРОВЫХ ПРОДУКТОВ ПОЛНОГО ЦИКЛА
          </span>
        </div>
      </section>
    </div>
  );
}

export default Main;
